import React, { useState, useEffect } from "react";
import api from "../api"; // axios with token
import "../App.css"; // reuse same animations & card styling

function OwnerDashboard() {
  const [stores, setStores] = useState([]);
  const [raters, setRaters] = useState([]);
  const [form, setForm] = useState({ name: "", email: "", address: "" });
  const [message, setMessage] = useState("");

  // Load dashboard data
  const fetchData = async () => {
    try {
      const res = await api.get("/owner/dashboard");
      setStores(res.data.stores);
      setRaters(res.data.raters);
    } catch (err) {
      console.error(err);
    }
  };

  useEffect(() => {
    fetchData();
  }, []);

  // Handle form input
  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  // Submit new store
  const handleAddStore = async (e) => {
    e.preventDefault();
    try {
      const res = await api.post("/owner/stores", form);
      setMessage(res.data.message);
      setForm({ name: "", email: "", address: "" });
      fetchData(); // refresh store list
    } catch (err) {
      setMessage(err.response?.data?.error || "Error adding store");
    }
  };

  return (
    <div className="dashboard-container animate-fadeIn">
      <h2 className="dashboard-title">Owner Dashboard</h2>

      {/* Store Add Form */}
      <div className="card animate-slideUp">
        <h3>Add New Store</h3>
        <form onSubmit={handleAddStore}>
          <input
            type="text"
            name="name"
            placeholder="Store Name"
            value={form.name}
            onChange={handleChange}
            required
          />
          <input
            type="email"
            name="email"
            placeholder="Store Email"
            value={form.email}
            onChange={handleChange}
          />
          <textarea
            name="address"
            placeholder="Store Address"
            value={form.address}
            onChange={handleChange}
            maxLength="400"
          />
          <button type="submit">Add Store</button>
        </form>
        {message && <p className="message">{message}</p>}
      </div>

      {/* Store List */}
      <div className="card animate-slideUp">
        <h3>My Stores</h3>
        <table>
          <thead>
            <tr>
              <th>Store Name</th>
              <th>Email</th>
              <th>Address</th>
              <th>Avg Rating</th>
              <th>Total Ratings</th>
            </tr>
          </thead>
          <tbody>
            {stores.map((s) => (
              <tr key={s.id}>
                <td>{s.name}</td>
                <td>{s.email || "-"}</td>
                <td>{s.address}</td>
                <td>{s.avg_rating || "0"}</td>
                <td>{s.ratings_count || "0"}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      {/* Raters List */}
      <div className="card animate-slideUp">
        <h3>Users Who Rated My Stores</h3>
        <table>
          <thead>
            <tr>
              <th>User</th>
              <th>Email</th>
              <th>Store</th>
              <th>Rating</th>
              <th>Rated At</th>
            </tr>
          </thead>
          <tbody>
            {raters.map((r, idx) => (
              <tr key={idx}>
                <td>{r.name}</td>
                <td>{r.email}</td>
                <td>{r.store_name}</td>
                <td>{r.rating}</td>
                <td>{new Date(r.updated_at).toLocaleString()}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default OwnerDashboard;
